                </ul>

                <span className='logout'><img src="https://res.cloudinary.com/dlf8flk1o/image/upload/v1696721682/dashboard/logout_tnsdpl.svg" alt=""></img>Log out</span>
            </nav>
        </div>

    );

}



export default Sidebar;
